import "./Process.css";

const Process = () => {
 const data =[
  {id: "01",
title
}
 ] 

 return (
 <section id="process">
  <div className="process-heading">
    <h3>Process</h3>
  </div>

  <div className="process-container">
    {
      data.map(process =>(
        <div className="process-box" key={process.id}>
          <span>{process.id}</span>
          <strong>{process.title}</strong>
        </div>
      ))
    }
  </div>
  </section>
  )
}

export default Process
